import styled from "styled-components";

interface IContainerProps {
    color: string;

}

export const Container = styled.div<IContainerProps>`
    width: 32%;
    height: 100px;
    margin: 10px 0;
    background-color: ${props => props.color};
    color: ${props => props.theme.colors.white};

`
